import React from "react";
import { Slider } from "../../component";
import Service from "./Service";
const Home = () => {
  return (
    <div>
      <div className="mt-4 min-w-full flex justify-center flex-col items-center h-screen">
        <Slider></Slider>
        <Service></Service>
      </div>
    </div>
  );
};

export default Home;
